import React from 'react';
import { AiFillLike } from 'react-icons/ai';
import { BiMessage } from 'react-icons/bi';
import { MdOutlineNotificationsActive } from 'react-icons/md';
import img1 from '../../../../image/sidebar-right-img/side-friend1.jpg';
import img2 from '../../../../image/sidebar-right-img/side-friend2.jpg';
import img3 from '../../../../image/sidebar-right-img/side-friend3.jpg';
import img4 from '../../../../image/sidebar-right-img/side-friend4.jpg';
import img5 from '../../../../image/sidebar-right-img/side-friend5.jpg';
import img6 from '../../../../image/sidebar-right-img/side-friend6.jpg';
import img7 from '../../../../image/sidebar-right-img/side-friend7.jpg';
import './NewsFieldRight.css';

const NewsFeedRightTop = () => {
    return (
        <div className="p-4">
            <h6 className="news-feed-title text-white pb-2">Your Page</h6>
            <div>
                <div className="d-flex align-items-center my-3">
                    <div className="page-profile-img rounded-pill">
                        <img className="img-fluid rounded-pill" src="http://www.wpkixx.com/html/winku-dark/images/resources/friend-avatar9.jpg" alt="Page_Image" />
                    </div>
                    <div className="ms-3 page-header">
                        <h6 className="m-0 mb-1">My Page</h6>
                        <p className="m-0"><BiMessage className="me-1" /><small>Messages</small></p>
                        <p className="m-0"><MdOutlineNotificationsActive className="me-1" /><small>Notifications</small></p>
                    </div>
                </div>
                <div className="d-flex mt-4">
                    <button className="border-0 page-like-btn text-white w-100">Likes</button>
                    <button className="border-0 page-view-btn text-white w-100">Views</button>
                </div>

                <div className="text-center mt-3">
                    <h4 className="d-flex align-items-center text-white justify-content-center"><AiFillLike style={{ color: '#088dcd' }} className="me-1" />884</h4>
                    <p style={{ color: '#088dcd' }}><small>35 New Likes This Week</small></p>
                </div>
                <div className="d-flex justify-content-center px-2 mt-2">
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img1} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img2} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img3} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img4} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img5} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img6} alt="People_Who_Liked_Page" />
                    </div>
                    <div className="page-bottom rounded-pill">
                        <img className="img-fluid rounded-circle" src={img7} alt="People_Who_Liked_Page" />
                    </div>
                </div>
            </div>

        </div>
    );
};

export default NewsFeedRightTop;
